import './style-control-section.css';



//* Блок управления Секциями
function ControlSection() {
    return (
        <div id="control-button">
            <div class="button-control-section" id="button-section-editor">Редактор Шаблонов</div>
            <div class="button-control-section" id="button-section-user-editor">Редактор Пользователей</div>
            <div class="button-control-section" id="button-section-logo-editor">Редактор Данных</div>
        </div>
    );
};

export default ControlSection;
